	add("darkwave", "{\"term\":\"darkwave\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|dark|wave|lang\u003den}}; compare \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A musical movement that originated in the late 1970s, combining elements of new wave and gothic rock with dark, thoughtful lyrics and an undertone of sorrow\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Jules Brown, Dinah Gardner, \u0027Hong Kong and Macau\u0027 (page 315\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"As well as mainstream pop you\u0027ll find dance, funk and all kinds of club music, world music and even very select genres such as \u0027\u0027darkwave\u0027\u0027 medieval, darkwave gothic to darkwave neofolk\", \"priority\":3}]}, \"synonyms\":{}}");

