	add("darlington", "{\"term\":\"darlington\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"From Old english (ca. 450-1100) Dearthington believed to be \u0027the settlement of Deornoth\u0027s people\u0027 (unclear root + ing \u0027a family group\u0027 + ton \u0027an enclosed farm or homestead\u0027) via Middle english (1100-1500) Dearnington and Derlinton. The family name is derived from the place name, simply meaning one who came from the village of Darlington. Most of the later place names are derived either from the Darlington family name, being named either after people with that family name, or are derived from the place name directly, being named after the original village of Darlington directly.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A town in Indian\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An unincorporated community in Marylan\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A city in Missour\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A borough in Pennsylvani\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A settlement in Prince Edward Islan\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A city in South Carolin\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A city and town in Wisconsi\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A town in County Durham, northeast England\", \"priority\":8}]}, \"synonyms\":{}}");

